    const containerStyle = {
      backgroundColor: '#154c69',
      color: 'white',
      padding: '20px',
    };
  
    const cardStyle = {
      backgroundColor: '#154c69',
      color: 'white',
    };
  
    // ... rest of your code ...
  
    return (
      <div className="Contact" style={containerStyle}>
        <Card style={cardStyle}>
          <CardContent>
            <Typography variant="h5" style={contactInfoStyle}>Contact Information</Typography>
            {/* ... rest of your code ... */}
          </CardContent>
        </Card>
      </div>
    );
  }
  
  export default Contact;
